// pages/Home.js
import ProductList from '../components/ProductList';

const Home = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-8">Welcome to Photo Store</h1>
      <ProductList />
    </div>
  );
};

export default Home;
